import React, { Component } from 'react';
import './Modal.css';
export default class Modal extends Component {
  onClose = (e) => {
    this.props.handleClose && this.props.handleClose(e);
  };
  render() {
    if (!this.props.show) {
      return null;
    }
    return (
      <div className="modal">
        <div className="modal-content">
          <div className="modal-header"></div>
        </div>
      </div>
    );
  }
}
